import './App.css';

const logoItem = [
  {id:1, title: "PORTFOLIO"},
  {id:2, title: "BLOG"},
  {id:3, title: "CV"},
  {id:4, title: "STORE"},
  {id:5, title: "FREELANCE"},
  {id:6, title: "ABOUT ME"},
  {id:7, title: "CONTACT"},
];

 function App() {

  return (
    <div>
      {logoItem.map((e) => {
        return(
          <div>
            <a href='#'>{e.title}</a>
          </div>
        );
      })}
    </div>
  )
}


export default App;
